<template>
	<text :style="{ color: color, fontSize: size + unit, fontWeight: bold ? 'bold' : 'normal' }" class="tui-icon" @click="handleClick">{{ icons[name] }}</text>
</template>

<script>
	import icons from './icons.js';
	// #ifdef APP-NVUE
	var domModule = weex.requireModule('dom');
	domModule.addRule('fontFace', {
		'fontFamily': 'thoruiFont',
		'src': "url('data:font/truetype;charset=utf-8;base64,')"
	});
	// #endif

	export default {
		name: 'thorIcon',
		props: {
			name: {
				type: String,
				default: ''
			},
			size: {
				type: Number,
				default: 32
			},
			//px或者rpx
			unit: {
				type: String,
				default: 'px'
			},
			color: {
				type: String,
				default: '#999'
			},
			bold: {
				type: Boolean,
				default: false
			},
			index: {
				type: Number,
				default: 0
			}
		},
		data() {
			return {
				icons: icons
			}
		},
		methods: {
			handleClick() {
				this.$emit('click', {
					index: this.index
				});
			}
		}
	};
</script>

<style scoped>
	/* #ifndef APP-NVUE */
	@charset "UTF-8";

	@font-face {
		font-family: 'thoruiFont';
		src: url(data:application/font-woff;charset=utf-8;base64,) format('woff');
		font-weight: normal;
		font-style: normal;
	}

	/* #endif */
	.tui-icon {
		font-family: thoruiFont;
		text-decoration: none;
		text-align: center;
	}
</style>
